import styled from "styled-components"

export default function Acount () {
    return(
        <AcountBox>
            <AcountLeft>
                <span style={{color: "#C6C6C6"}}>30/11</span><span> Almoço mãe</span>
            </AcountLeft>
            <AcountRight>
                <span>39,90</span>
            </AcountRight>
        </AcountBox>
    );
}

const AcountBox = styled.div`
    width: 100%;
    display: flex;
    justify-content: space-between;
    span {
        font-family: 'Raleway';
        font-size: 16px;
    }
`;
const AcountLeft = styled.div`
    margin-left: 15px;
    span {
        margin-left: 15px;
    }
`
const AcountRight  = styled.div`
    margin-right: 15px;
    color: #C70000;
`
